import type { ITrack } from './tracks/types';
declare class Clip {
    name: string;
    frameCount: number;
    duration: number;
    tracks: Array<ITrack>;
    timeStamps: Array<Float32Array>;
    /** Translate GLTF Animation to Armature Animation Clip */
    static fromGLTF2(anim: any): Clip;
}
export default Clip;
